import React from 'react';
import Drawer from '@mui/material/Drawer';

const LeftDrawer = () => {
  return (
    <Drawer
      variant='permanent'
      sx={{
        display: { xs: 'none', sm: 'block' },
        '& .MuiDrawer-paper': { boxSizing: 'border-box', width: '10%' },
      }}
      open
    >
      <h1>Left Drawer</h1>
    </Drawer>
  );
};

export default LeftDrawer;
